Private Lies (2001 VCA) [DVDRip]

Allysin Chaynes, Dominique Dewitt, Jenna Davis, Zana, Chris Cannon, Kyle Stone, Steve Hatcher, Tyce Bune

A Sexy Mystery Heats Up In The Wild-Side of Town

Cricket and Jessica are Private Eyes with the emphasis on &quot;private&quot;. While searching for a missing girl on the wild side of town, our heroines find themselves deep undercover at a hot sex club.
Pretty soon the case breaks wide open and it turns out their curiosity isn't the only thing that ends up satisfied.

